n='allowed'/><yt:accessControl action='embed' permission='allowed'/><yt:accessControl action='list' permission='allowed'/><yt:accessControl action='autoPlay' permission='allowed'/><yt:accessControl action='syndicate' permission='allowed'/><gd:comments><gd:feedLink rel='http://gdata.youtube.com/schemas/2007#comments' href='http://gdata.youtube.com/feeds/api/videos/MTh-ZgbSXyc/comments?v=2' countHint='107'/></gd:comments><yt:hd/><media:group><media:category label='Sports' scheme='http://gdata.youtube.com/schemas/2007/categories.cat'>Sports</media:category><media:content url='http://www.youtube.com/v/MTh-ZgbSXyc?version=3&amp;f=videos&amp;d=AS7Qxt7jHWCNTkXMPW-oJOUO88HsQjpE1a8d1GxQnGDm&amp;app=youtube_gdata' type='application/x-shockwave-flash' medium='video' isDefault='true' expression='full' duration='640' yt:format='5'/><media:content url='rtsp://v2.cache3.c.youtube.com/CkULENy73wIaPAknX9IGZn44MRMYDSANFEgGUgZ2aWRlb3NyIQEu0Mbe4x1gjU5FzD1vqCTlDvPB7EI6RNWvHdRsUJxg5gw=/0/0/0/video.3gp' type='video/3gpp' medium='video' expression='full' duration='640' yt:format='1'/><media:content url='rtsp://v8.cache7.c.youtube.com/CkULENy73wIaPAknX9IGZn44MRMYESARFEgGUgZ2aWRlb3NyIQEu0Mbe4x1gjU5FzD1vqCTlDvPB7EI6RNWvHdRsUJxg5gw=/0/0/0/video.3gp' type='video/3gpp' medium='video' expression='full' duration='640' yt:format='6'/><media:credit role='uploader' scheme='urn:youtube' yt:display='parkinggod'>parkinggod</media:credit><media:description type='plain'>September 3, 2011. Michigan 34, Western Michigan 10. Lightning brought this game to an end late in the third quarter, which was probably just as well for the Broncos as Michigan was starting to pull away. Michigan spotted Western a touchdown but outscored them 34-3 the rest of the way. Brandon Herron had a 94-yard interception return for a touchdown (longest in school history) and a 28-yard fumble return for a touchdown, the first time a Michigan player has ever returned two turnovers for touchdowns in the same game. Fitzgerald Toussaint ran for 80 yards and two touchdowns (2, 1) and Michael Shaw added 54 yards and a touchdown (44). Jordan Kovacs helped pace the defense with two sacks and a forced fumble.</media:description><media:keywords>Michigan, Football, 2011, Western, Brandon, Herron, Fitzgerald, Toussaint, Michael, Shaw, Jordan, Kovacs</media:keywords><media:license type='text/html' href='http://www.youtube.com/t/terms'>youtube</media:license><media:player url='http://www.youtube.com/watch?v=MTh-ZgbSXyc&amp;feature=youtube_gdata_player'/><media:thumbnail url='http://i.ytimg.com/vi/MTh-ZgbSXyc/default.jpg' height='90' width='120' time='00:05:20' yt:name='default'/><media:thumbnail url='http://i.ytimg.com/vi/MTh-ZgbSXyc/hqdefault.jpg' height='360' width='480' yt:name='hqdefault'/><media:thumbnail url='http://i.ytimg.com/vi/MTh-ZgbSXyc/1.jpg' height='90' width='120' time='00:02:40' yt:name='start'/><media:thumbnail url='http://i.ytimg.com/vi/MTh-ZgbSXyc/2.jpg' height='90' width='120' time='00:05:20' yt:name='middle'/><media:thumbnail url='http://i.ytimg.com/vi/MTh-ZgbSXyc/3.jpg' height='90' width='120' time='00:08:00' yt:name='end'/><media:title type='plain'>2011 Michigan football highlights v. Western Michigan (HD)</media:title><yt:aspectRatio>widescreen</yt:aspectRatio><yt:duration seconds='640'/><yt:uploaded>2011-09-04T03:12:33.000Z</yt:uploaded><yt:videoid>MTh-ZgbSXyc</yt:videoid></media:group><gd:rating average='4.7009344' max='5' min='1' numRaters='107' rel='http://schemas.google.com/g/2005#overall'/><yt:statistics favoriteCount='70' viewCount='74709'/><yt:rating numDislikes='8' numLikes='99'/></entry><entry gd:etag='W/&quot;Ak4MR347eCp7I2A9WhRbGUg.&quot;'><id>tag:youtube.com,2008:video:z6PqcKegRPo</id><published>2011-11-29T02:38:29.000Z</published><updated>2012-02-11T11:16:26.000Z</updated><category scheme='http://schemas.google.com/g/2005#kind' term='http://gdata.youtube.com/schemas/2007#video'/><category scheme='http://gdata.youtube.com/schemas/2007/categories.cat' term='Sports' label='S