73IlxMYESARFEgGUgZ2aWRlb3NyIQEu0Mbe4x1gjU5FzD1vqCTlDvPB7EI6RNWvHdRsUJxg5gw=/0/0/0/video.3gp' type='video/3gpp' medium='video' expression='full' duration='483' yt:format='6'/><media:credit role='uploader' scheme='urn:youtube' yt:display='getintofootball' yt:type='partner'>getintofootball</media:credit><media:description type='plain'>Spain 0 - 2 Brazil The final matched up Brazil against Spain, in what was predicted to be quite a tight affair. Spain, who were yet to concede a goal in the tournament and had won every game on their way to the final, were going to have to be at their best defensively to stop a Brazil side that boasted two of the tournaments biggest talents, Ricardo Alves and the player of the tournament Jeferson Goncalves. Spain Alvaro Gonzalez (GK), Jose Luis Giera, Carmelo Garrido, Adolfo Acosta, Antonio Martin, Alfredo Cuadrado, Pedro Villa, Vicente Aguilar, Marcelo Rosado, Raul Diaz (GK) Alfredo Cuadrado, Vicente Aguilar Brazil Fabio Vasconcelos (GK), Scharles Santos, Damiao Souza, Marcos Felipe, Jeferson Goncalves, Sandro Soares, Joao Silva, Ricardo Alves, Severino Silva, Antonio Carvalho (GK) Jeferson Goncalves, Ricardo Alves Match Officials: Mariano Trvaglino, Germinal Lubrano, Paul Leversuch, Craig Grundy Attendance: 703 Third Place Playoff China 1 - 0 England The first game of the last day saw the clash for third place in the tournament between England and China. The game got off to a good start for England with Jonathan Gribbin and David Clarke both having chances to give them an early lead, but the Lei Niu saved well on both occasions. The England defence was well marshalled by Will Norman and they limited China to only speculative long range efforts which didn't trouble Skyres in goal.</media:description><media:keywords>the, fa, blind, world, cup, england, goal, spain, hereford, IBSA, Football, Championship, 2010, brazil, china</media:keywords><media:license type='text/html' href='http://www.youtube.com/t/terms'>youtube</media:license><media: